import React from 'react';
import './Banner.scss';

const Banner = () => {
  return (
    <div className="banner">
      <img
        src="./image/banner.png"
        alt="Miss Dior Banner"
        className="banner-image"
      />
      <div className="banner-content">
        <h1>Miss Dior</h1>
        <p>The New Parfum</p>
      </div>
    </div>
  );    
};

export default Banner;
